const TabScreen = () => {

    return (
        <Tabs.Navigator
            headerMode="none"
            // screenOptions={{
            //     activeTintColor: "#FFC300",
            //     inactiveTintColor: "#353935",
            //     style: {
            //         labelStyle: { fontSize: 1 },
            //     }
            // }}
            screenOptions={{
                activeTintColor: "#50d3a7",
                 tabBarActiveTintColor: '#fff',
              tabBarInactiveTintColor: '#ddd',
                inactiveTintColor: "white",
                tabBarPressColor: '#cec6c6',
                tabBarShowIcon: true,
                tabBarIndicatorStyle: {
                    backgroundColor: '#9A8340',
                },

                tabBarStyle: {
                    borderTopColor: "9A8340",
                    borderTopWidth: 2,
                    elevation: 10,
                    backgroundColor: '#0B090A',
                    borderRadius: 1

                },
            }}
        // tabBarOptions={{
        //     activeTintColor: '#ffffff',
        //     inactiveTintColor: '#ffffff',
        //     showIcon: true,
        //     pressColor: '#856',
        //     scrollEnabled: false,
        //     tabStyle: { backgroundColor: '#000', borderRadius: 10, margin: 12, justifyContent: 'center', alignContent: 'center' },
        //     indicatorStyle: { backgroundColor: '#987', opacity: 0.05 },
        //     style: {
        //         backgroundColor: '#000000', borderRadius: 30, margin: 24, height: 72, width: '90%',
        //         labelStyle: { fontSize: 2 },
        //     }
        // }}
        >

            <Tabs.Screen
                name="Logistic"
                component={Logisticscreen}
            />
            
            <Tabs.Screen
                name="Store"
                component={Ecommerce}
                options={{
      headerShown: false,}}
            />
            <Tabs.Screen
                name="Social Media"
                component={SocialMedia}
            />

            <Tabs.Screen
                name="Yoris Pay"
                component={Fintech1}
                options={{
      headerShown: false,}}
            />


        </Tabs.Navigator >


    )

}



export const AccountNavigator  = () => {
    return(
    <Screens.Navigator
            headerMode="none"
            screenOptions={{
        headerShown: false,
      }}
    >
    <Tabs.Screen
                name="Tabs"
                component={TabScreen}
            />
       <Screens.Screen
                    name="Ecommerce"
                    component={Ecommerce}
                />
        <Screens.Screen
                    name="Fintech1"
                    component={Fintech1}
                />        
                <Screens.Screen
                    name="Ecommerce2"
                    component={Ecommerce2}
                />
                <Screens.Screen
                    name="Ecommerce3"
                    component={Ecommerce3}
                />
                <Screens.Screen
                    name="Ecommerce4"
                    component={Ecommerce4}
                />
                <Screens.Screen
                    name="Ecommerce5"
                    component={Ecommerce5}
                />
                <Screens.Screen
                    name="Ecommerce6"
                    component={Ecommerce6}
                />
                <Screens.Screen
                    name="Ecommerce7"
                    component={Ecommerce7}
                />
                <Screens.Screen
                    name="Ecommerce8"
                    component={Ecommerce8}
                />    
            
        <Screens.Screen
                    name="MobileTopUp"
                    component={MobileTopUp}
                /> 
        <Screens.Screen
                    name="MobileTopUp2"
                    component={MobileTopUp2}
                />
          <Screens.Screen
                    name="Message"
                    component={Message}
                /> 
          <Screens.Screen
                    name="Vendor1"
                    component={Vendor1}
                />             
         <Screens.Screen
                    name="Hotel"
                    component={Hotel}
                /> 
         <Screens.Screen
                    name="Hotel2"
                    component={Hotel2}
                />    
         <Screens.Screen
                    name="Gym"
                    component={Gym}
                /> 
         <Screens.Screen
                    name="Gym2"
                    component={Gym2}
                />
          <Screens.Screen
                    name="Food1"
                    component={Food1}
                />        
          <Screens.Screen
                    name="Food2"
                    component={Food2}
                /> 
          <Screens.Screen
                    name="Food3"
                    component={Food3}
                />  
                <Screens.Screen
                    name="Food4"
                    component={Food4}
                />
                <Screens.Screen
                    name="Procurement1"
                    component={Procurement1}
                /> 
                <Screens.Screen
                    name="Procurement11"
                    component={Procurement11}
                /> 
                <Screens.Screen
                    name="Procurement8"
                    component={Procurement8}
                    initialParams={{
            paramKey:'Link'
        }}
                /> 
                <Screens.Screen
                    name="Procurement4"
                    component={Procurement4}
                /> 
                <Screens.Screen
                    name="Procurement5"
                    component={Procurement5}
                /> 
                <Screens.Screen
                    name="Procurement7"
                    component={Procurement7}
                /> 
           <Screens.Screen
                    name="Procurement3"
                    component={Procurement3}
                />  
                <Screens.Screen
                    name="Procurement2"
                    component={Procurement2}
                />  
                <Screens.Screen
                    name="Procurement10"
                    component={Procurement10}
          />  
                <Screens.Screen
                    name="Procurement6"
                    component={Procurement6}
                    initialParams={{
            paramKey:'Link'
        }}
                />  
                <Screens.Screen
                    name="Procurement9"
                    component={Procurement9}
                    initialParams={{
            paramKey:'Link'
        }}
                />  
               <Screens.Screen
                    name="Vendor2"
                    component={Vendor2}
                    initialParams={{
            image:require('../../../assets/header.png')
        }}
                />   
               <Screens.Screen
                    name="CalendarScreen"
                    component={CalendarScreen}
                    initialParams={{
            paramKey:'Link'
        }}
                />       
                <Screens.Screen
                    name="LogisticBooking"
                    component={LogisticBooking}
                />   
      <Stack.Screen name="logisticsMain" component={Logisticscreen} />
      <Stack.Screen name="pickUp" component={PickUp} />
      <Stack.Screen name="dropOff" component={DropOff} />
      <Stack.Screen name="confirmOrder" component={ConfirmOrder} />
      <Stack.Screen name="logisticBooking" component={LogisticsAddress} />
      <Stack.Screen name="logisticsVehicle" component={LogisticsVehicle} />
      <Stack.Screen name="logisticsDetails" component={LogisticsDetails} />
      <Stack.Screen name="logisticsOrder" component={LogisticsOrder} />
      <Stack.Screen name="shipping" component={LogisticsShipping} />
      <Stack.Screen name="paymentScreen" component={PaymentScreen} />
      <Stack.Screen name="paymentOptions" component={PaymentOptions} />
      <Stack.Screen name="confirmPayment" component={ConfirmedPayment} />
      <Stack.Screen name="orderHistory" component={OrderHistory} />
      <Stack.Screen name="singleOrder" component={SingleOrder} />
      <Stack.Screen name="riderOrder" component={RiderOrder} />
      <Stack.Screen name="profile" component={Profile} />          
      <Stack.Screen name="profile" component={ProfileScreen} />     

    </Screens.Navigator>
    )

